import React, {Component} from 'react';
import Container from "react-bootstrap/Container";
import {Button} from "react-bootstrap";
import Next from "./CreateAccount";
import {Redirect, useHistory, Link} from 'react-router-dom'

const onStart = () => {
  if(true){
  return  <Redirect to="./Account_Setup/CreateAccount" />
  }
}

class Home extends Component {



  render(){

    return(
      <div className="home-container-top">
        <div className="home-container">
          <div className="home-text-container">
            <p className="home-text">
              Make a website to improve your business
            </p>
            <div className="homebtn-getstarted-container">
              <Button variant="btn btn-primary"
                className="homebtn-getstarted" href={onStart()}>
                Get Started
              </Button>
            </div>
          </div>
          <div className="home-image-container">
            <img
              src="https://purepng.com/public/uploads/large/purepng.com-running-womenrunnerjoggingjumpingrunning-women-1421526963993vkpyk.png"
              height="100%"
              width="100%"
              alt="runner image"
            />
          </div>
        </div>
      </div>
    )};
};

export default Home;
